                              <li>
                                 <h3>Subseries I.U. Membership</h3>
                                 <p><strong>Date: </strong>1960-1995; 1965-1983 bulk
                                 </p>
                                 <p><strong>Extent: </strong>250 folders (12.75 linear feet)
                                 </p>
                                 <p><strong>Description: </strong>
                                    						Application forms, resumes, correspondence, memos, notes, drafts, invoices,
                                    receipts, rosters, ledgers, and computer printouts are organized into 9 sub-subseries:
                                    applications, Correspondence, Directories, Dues &amp; Subscriptions, Members, Membership
                                    Committee, Surveys &amp; Questionnaires, Member List/Computer Printout, Ledgers. Application
                                    files are in date order by year and then in alphabetical order by name. Correspondence
                                    is divided into two groups; general correspondence arranged in date order and subject
                                    files in alphabetical order. Directories, Dues &amp; Subscriptions, and Members are arranged
                                    in alphabetical order by subject and then in date order. The subseries Membership
                                    Committee, Surveys &amp; Questionnaires, Member List/Computer Print Out, and Ledgers are
                                    arranged in date order by year.
                                    					
                                 </p>
